func ExampleGetKeyType() {
	certs, ok := certutils.GenCertsFromPem([]byte(sha1cert))
	if ok {
		c := certs[0]
		fmt.Printf("%v\n", GetKeyType(c.PublicKeyAlgorithm))
	}

	certs, ok = certutils.GenCertsFromPem([]byte(trustasia))
	if ok {
		c := certs[0]
		fmt.Printf("%v\n", GetKeyType(c.PublicKeyAlgorithm))
	}

	// Output:
	// RSA
	// ECDSA
}

func ExampleGetKeyLong() {
	certs, ok := certutils.GenCertsFromPem([]byte(sha1cert))
	if ok {
		c := certs[0]
		fmt.Printf("%v\n", GetKeyLong(c.PublicKey))
	}

	certs, ok = certutils.GenCertsFromPem([]byte(trustasia))
	if ok {
		c := certs[0]
		fmt.Printf("%v\n", GetKeyLong(c.PublicKey))
	}

	// Output:
	// 2048
	// 256
}

func ExampleGetSignatureAlgorithm() {
	certs, ok := certutils.GenCertsFromPem([]byte(sha1cert))
	if ok {
		c := certs[0]
		fmt.Printf("%v\n", GetSignatureAlgorithm(c.SignatureAlgorithm))
	}

	certs, ok = certutils.GenCertsFromPem([]byte(trustasia))
	if ok {
		c := certs[0]
		fmt.Printf("%v\n", GetSignatureAlgorithm(c.SignatureAlgorithm))
	}

	certs, ok = certutils.GenCertsFromPem([]byte(baidu))
	if ok {
		c := certs[0]
		fmt.Printf("%v\n", GetSignatureAlgorithm(c.SignatureAlgorithm))
	}

	// Output:
	// SHA1WithRSA
	// ECDSAWithSHA256
	// SHA256WithRSA
}

func TestGetAuditType(t *testing.T) {
	assert := assert.New(t)
	certs, ok := certutils.GenCertsFromPem([]byte(trustasia))
	if ok {
		c := certs[0]
		t := GetAuditType(c)
		assert.Equal(EV, t)
	}

	certs, ok = certutils.GenCertsFromPem([]byte(baidu))
	if ok {
		c := certs[0]
		t := GetAuditType(c)
		assert.Equal(OV, t)
	}

	certs, ok = certutils.GenCertsFromPem([]byte(imququ))
	if ok {
		c := certs[0]
		t := GetAuditType(c)
		assert.Equal(DV, t)
		assert.Equal(1, t)
	}

}

func ExampleGenerateSubject() {
	certs, ok := certutils.GenCertsFromPem([]byte(baidu))
	if ok {
		c := certs[0]
		s := GenerateSubject(c.Subject)
		d, _ := json.Marshal(s)
		fmt.Printf("%v", string(d))
	}

	// Output:
	//{"common_name":"baidu.com","organization":"BeiJing Baidu Netcom Science Technology Co., Ltd","organizational_unit":"service operation department.","street_address":"","locality":"beijing","province":"beijing","country":"CN"}
}

func ExampleGenerateExtKeyUsage() {
	certs, ok := certutils.GenCertsFromPem([]byte(baidu))
	if ok {
		c := certs[0]
		s := GenerateExtKeyUsage(c.ExtKeyUsage)
		fmt.Printf("%v", s)
	}

	// Output:
	// Server authentication,Client authentication
}

func TestIsEv(t *testing.T) {
	assert := assert.New(t)
	certs, ok := certutils.GenCertsFromPem([]byte(trustasia))
	if ok {
		c := certs[0]
		assert.Equal(true, GetAuditType(c) == EV)
	}

	certs, ok = certutils.GenCertsFromPem([]byte(sb))
	if ok {
		c := certs[0]
		assert.Equal(true, GetAuditType(c) == EV)
	}

	certs, ok = certutils.GenCertsFromPem([]byte(imququ))
	if ok {
		c := certs[0]
		assert.Equal(false, GetAuditType(c) == EV)
	}

	certs, ok = certutils.GenCertsFromPem([]byte(baidu))
	if ok {
		c := certs[0]
		assert.Equal(false, GetAuditType(c) == EV)
	}
}

