func TestCheckSignFromRoot(t *testing.T) {
	assert := assert.New(t)

	os.Chdir("../../app/reportapp")
	certs, ok := certutils.GenCertsFromPem([]byte(mall10010))
	assert.Equal(true, ok)
	assert.Equal(4, len(certs))
	if ok {
		t := certutils.CheckRoot(certs[1])
		assert.Equal(true, t)

		t = certutils.CheckRoot(certs[2])
		assert.Equal(true, t)
	}

	certs, ok = certutils.GenCertsFromPem([]byte(mondora))
	assert.Equal(true, ok)
	if ok {
		t := certutils.CheckRoot(certs[1])
		assert.Equal(false, t)
	}
}

