func TestCheckRoot(t *testing.T) {
	assert := assert.New(t)
	certs, ok := certutils.GenCertsFromPem([]byte(rootVeriSignMD2))
	assert.Equal(true, ok)
	if ok {
		root := certutils.CheckRoot(certs[0])
		assert.Equal(true, root)
	}

	certs, ok = certutils.GenCertsFromPem([]byte(rootTrustQual))
	assert.Equal(true, ok)
	if ok {
		root := certutils.CheckRoot(certs[0])
		assert.Equal(true, root)
	}

	certs, ok = certutils.GenCertsFromPem([]byte(intermediateTrustasia))
	assert.Equal(true, ok)
	if ok {
		root := certutils.CheckRoot(certs[0])
		assert.Equal(false, root)
	}
}

