func TestGetFullChain(t *testing.T) {
	assert := assert.New(t)

	os.Chdir("../../app/reportapp")

	tests := []struct {
		pems            string
		certLen         int
		rootFromServer  bool
		certstatus      byte
		chainStatus     byte
		leafOrder       int
		additionalOrder int
		rootOrder       int
		des             string
	}{
		{hsuleiECC, 3, false, 0x01, 0x00, 1, 2, 0, "hsuleiECC"},
		{hsuleiECCWithMoreIntermediate, 3, false, 0x01, 0x02, 1, 2, 0, "hsuleiECCWithMoreIntermediate"},
		{hsuleiEccWithMoreRoot, 3, true, 0x01, 0x04, 1, 2, 3, "hsuleiEccWithMoreRoot"},
		{hsuleiEccWithMoreWrongRoot, 3, false, 0x01, 0x02, 1, 2, 0, `hsuleiEccWithMoreWrongRoot`},
		{hsuleiECCWithWronIntermediateAndRoot, 3, true, 0x01, 0x06, 1, 2, 4, "hsuleiECCWithWronIntermediateAndRoot"},
		{hsuleiECCWithWronIntermediateAndWrongRoot, 3, false, 0x1, 0x02, 1, 2, 0, "hsuleiECCWithWronIntermediateAndWrongRoot"},
		{hsuleiECCLessRightIntermediate, 3, false, 0x02, 0x00, 1, 0, 0, "hsuleiECCLessRightIntermediate"},
		{hsuleiECCLessRightIntermediateAndMoreWrongIntermediate, 3, false, 0x02, 0x02, 1, 0, 0, "hsuleiECCLessRightIntermediateAndMoreWrongIntermediate"},
		{hsuleiECCLessRightIntermediateAndMoreRoot, 3, true, 0x02, 0x04, 1, 0, 2, "hsuleiECCLessRightIntermediateAndMoreRoot"},
		{hsuleiECCLessRightIntermediateAndMoreWrongRoot, 3, false, 0x02, 0x02, 1, 0, 0, "hsuleiECCLessRightIntermediateAndMoreWrongRoot"},
		{hsuleiECCLessRightIntermediateAndMoreWrongIntermediateAndRoot, 3, true, 0x02, 0x06, 1, 0, 3, "hsuleiECCLessRightIntermediateAndMoreWrongIntermediateAndRoot"},
		{hsuleiECCLessRightIntermediateAndMoreWrongIntermediateAndWrongRoot, 3, false, 0x002, 0x02, 1, 0, 0, "hsuleiECCLessRightIntermediateAndMoreWrongIntermediateAndWrongRoot"},
	}

	for _, test := range tests {
		certs, ok := certutils.GenCertsFromPem([]byte(test.pems))
		assert.Equal(true, ok, test.des)
		if ok {
			_, result, err := GetFullChain(context.Background(), certs)
			assert.Nil(err, test.des)
			if err == nil {
				assert.Equal(test.certLen, len(result.Certs), test.des+" order")
				assert.Equal(test.rootFromServer, result.Certs[len(result.Certs)-1].IsServer, test.des+" rootFromServer")
				assert.Equal(test.certstatus, result.CertStatus, test.des+"  certstatus")
				assert.Equal(test.chainStatus, result.ChainStatus, test.des+" chainstatus")
			}

		}
	}
}

